import "./CardDest.css";

function CardDest(props) {
    return (
        <div class="row">
            <div class="col-md-12 text-center">
                <p id="tn">La Tunisie</p>
                <p class="lead" id="dest">Destinatin De Camping</p>
            </div>
        </div>
    );
}

export default CardDest;
